public NodeId getAssignedNode() {
  if (this.nodeId != null) {
    return this.nodeId;
  }
  ContainerReportProtoOrBuilder p = viaProto ? proto : builder;
  if (!p.hasNodeId()) {
    return null;
  }
  this.nodeId = convertFromProtoFormat(p.getNodeId());
  return this.nodeId;
}
